11770460-120a-5b35-8d7d-1a4e44c303c0=Once the Navigation Layout has been selected you can now choose the type of page. The Mendix Business Modeler comes with pre-defined templates for an extensive set of page types like Dashboard, Master-detail, and Wizard to name a few. Again for every type of device. \r\n\r\nYou can also choose to start with an empty page and build it yourself using our fully responsive Layout Grid that makes easy to create responsive UI that scales on any device. \r\n
