44584203-0d0a-5a20-b003-7df3405fcc38=You can further design your page by connecting data elements and adding additional widgets from the rich set of user interface elements that come with the platform. \r\n\r\nNow it\u2019s time to \u2018put the dots on the i\u2019. By using Design Elements, the standard widgets can be styled quickly to your preference for style, color, size, alignment and attachment.
