d941b7ff-4062-51ef-bc64-a947e0fd0b23=This theme is based on the Mendix UI Framework, which is completely open source and accessible on GitHub. The framework leverages Bootstrap, Sass, Compass and Scout. \r\n\r\nBuild your own custom theme based on the Mendix UI Framework or even contribute to the framework on GitHub. \r\n
