5614c7e2-311d-533a-a620-60680eced7c4=In a life filled with hospital visits, medical treatments and uncertainty, dreams can seem unattainable. Make-A-Wish\u00ae knows that a wish experience can be a game-changer for a child with a life-threatening medical condition. Wear this design and know that your purchase will help enrich a child\u2019s experience with hope, strength, and joy. Support this incredible cause with each purchase\!
c48a4883-9591-5502-849f-9d0159b83675=Shipping & Returns
d59ef010-043b-5127-91ee-9f82bfc19411=We're committed to getting your order to you as soon as possible (because we know how much you want it\!). As soon as you place your order, we go to work to make that happen. Give us 1 day to process your specific order (we design everything just for you) and 1 day to make your product, and 1 day to package it up with love and send it on its journey to you. We'll be very excited at that point, and will send you an email with a link to track your order. We call it our \u201c1-2-3 policy.\u201d
49fc6859-7e45-5a41-a6cc-0bc706d3f03a=How Does Sevenly Handle Returns?
1c8ba909-d310-5a33-9a20-ebfcf86d7407=We understand that ordering online can be difficult\! If your clothing item doesn\u2019t fit, please send it back to us within 60 days of purchase and if we have the size you need available, we will send it to you at no additional cost to you. If we do not have the size available, we would be more than happy to give you the full amount back in store credit minus the $7 donation associated with the order (This will have already been donated to the charity).
